import {createSlice, nanoid} from "@reduxjs/toolkit";

const initialState = [{"date": "2022-04-15","id":"W3IbXluGxG1mnV5c5jzAL","title":"Visiting the heart of Poland, Warsaw!","content":"Warsaw\nA phoenix arisen from the ashes, Poland's capital impresses with its resilience, respect for history, contemporary style and sheer joie de vivre.\n\nDiverse Architecture\nRather than being centred on an old market square, modern-day Warsaw is spread across a broad area and includes an eye-catching range of architecture: restored baroque, Gothic, neoclassical and Renaissance in the Old and New Towns; gems of the post-WWII socialist realist period, such as the Palace of Culture & Science and the Marszałkowska Residential District (MDM); and contemporary beauties like the Copernicus Science Centre and the POLIN Museum of the History of Polish Jews. This jumble reflects the city’s tumultuous past and makes for a fascinating collection of neighbourhoods and landmarks.\n\nBeautiful Outdoor Spaces\nAs the royal capital for several centuries, Warsaw is blessed with the beautiful palace and parklands at Wilanów, aptly described as Poland's Versailles, and the park and serene Palace on the Isle of Łazienki. Greenery also abounds at the central Saxon Garden, Krasiński Garden and the rooftop garden of the University Library. Not to be missed is a stroll beside the Vistula River: on the west bank runs the Vistulan Boulevard, a contemporary promenade dotted with waterside bars and cafes, while on the eastern Praga side nature holds sway with meandering, wooded pathways leading to sandy beaches.\n\nCultural Treasures\nWarsaw has endured the worst history could throw at it, including near destruction at the end of WWII. Much has been rebuilt and the fragments that survived are now preserved in a superb selection of museums and cultural storehouses. The exhibitions at the Warsaw Rising Museum and POLIN Museum of the History of Polish Jews leave practically no stone unturned on their respective subjects, while the National Museum will astound you with its art and design collection. Then there is Chopin, Warsaw's favourite son, who has his own museum and whose romantic and dramatic music is played at nightly recitals.\n\nEat, Drink, Be Merry\nIf the city's architectural flourishes, lush outdoor spaces and cultural treasures haven't already seduced you, expect all resistance to fall at its superb selection of dining spots. Home to everything from bargain-priced, retro-trendy milk bars to chic restaurants serving cutting-edge molecular gastronomy, Warsaw is a culinary delight. There's also no shortage of cool cafes or bars for creative cocktails, craft beers and vodka shots. This is a city that knows how to have fun, whether it be glamming up for the opera or a symphony performance or clubbing it through the night.","position":{"lat":52.2371607711983,"lng":21.043633382812484},"image":"data:image/png;base64,"},{"date": "2021-10-09","id":"zEKNaoCrcNnGvY67w6TeI","title":"Walking on the mountains!","content":"More than two weeks ago I went on a Poland road trip with my familia and I had an incredible time. We visited Warsaw, Krakow which I already covered in the last two travel posts. Now it’s time to talk about the main thing that made us pack our bags and go on this little road trip. The Tatra Mountains. On the second day of our trip, we have arrived at Zakopane, where we stayed 3 days/2 nights. I will talk more about our stay there in the next post, now let’s focus on the hiking part.\n\nThere are a lot of traces for hiking in these mountains and one day is not enough for sure. For our first hike in the Tatra we chose a trail that is only about 12 kilometres long. We have hiked before, so we did know that we are signing up for. But boy, we were wrong.\n\nWe decided to hike the whole trail from the lowest point to the highest which means that we were going up the whole hike. And that took a lot of energy. There were few stops along the way where you could take a breather, snack or take a toilet break (ALWAYS TAKE A TOILET BREAK!). Somewhere in the middle of the hike we reached this beautiful lake surrounded by mountains. We couldn’t stop ourselves from making a stop and sitting a bit near it.\n\nThe thing that broke us emotionally and mentally was when we looked up where will we go hiking next after this lake stop. The hill was so freaking steep!! I can’t even explain to you. I was not ready for that. And I was right. I thought that I’ll die in the middle of these mountains. Not a bad place to be buried at, now that I think so. But finally we reached the top and it was the most rewarding feeling ever!","position":{"lat":49.29770758186722,"lng":19.983452718749984},"image":"data:image/png;base64,"},{"date": "2021-07-23", "id":"7cJiEAUBM2p_FF2G6xqwb","title":"Admiring lakes and beautiful polish side","content":"You could spend weeks sailing the Masurian lakes, connected by rivers and channels, but even a weekend will suffice to make you fall in love with one of the most beautiful inland sailing routes in Europe and a real treasure of Poland’s nature.\n5259921787_e70ffe90cc_o.jpgThe wind in your hair when sailing the Omega yacht, sunsets at the lake, smoke-flavoured tea brewed over campfire, and the woodland, navy blue with bilberries – this is what a summer in the Masuria may bring you.\n\n“This is a unique place, not only in Poland, but also in the world,” says Andrzej Szocik, sailing instructor and judge. With 60 years’ experience of sailing different waters, he still finds pleasure in coming back to his favourite Nidzkie and Dobskie lakes, surrounded by hills and woodlands.\n\nThe Masurian Lake District has more than two thousand lakes larger than one hectare. Already in the 18th century, channels were created to join the larger ones. This gave rise to the trail of the Great Masurian Lakes – one of the most beautiful inland sailing routes in Europe (about 130 km long) which runs from Węgorzewo through Giżycko and Mikołajki to Pisz, across such lakes as Mamry, Kisajno, Niegocin and Śniardwy, the largest lake in Poland (with an area of more than 113 square kilometers).\n\n“Many have found their haven here and do not imagine spending their holiday anywhere else,” says Robert Kempa, head of the Giżycko Promotion Centre and Tourist Information, the largest sailing and water sports centre in Poland. He believes that the sentiment for Masuria, located in the north-eastern part of the country, is in Poles’ blood, as they come here for summer camps as children, and later on to sail or just camp.\n\nWith their numerous little bays, peninsulas and islands, moraine hills, woodlands, rivers and streams, the lakes are an essence of the Masurian landscape. Sailing is not the only way to see them. The rivers in Masuria and the neighbouring Warmia are popular as kayaking trails; one of the most beautiful routes is the Krutynia river (about 100 km), which runs through more than a dozen lakes and the Pisz Forest.\n\nDivers are attracted by Arabella, a shipwreck in the waters of the Mamry lake, or by the wavy underwater meadows of Świętajno. The firebreaks in the forests and roads across the fields are best travelled by bike or on horseback. “My favourite bicycle trail runs along the shores of the Wojnowo and Buwełno lakes,” reveals Robert Kempa. “The views are fabulous there!”\n\nMasuria is among the 28 finalists in the global plebiscite for the new seven wonders of nature, held in 2011 by the Swiss New7Wonders foundation. In the final voting, the expert jury headed by Professor Federico Mayor Zaragoza, former Director-General of UNESCO, ranked the Masurian Lake District as fourteenth.\n\nLeaving the Great Masurian Lakes towards the west and heading for Warmia and Powiśle, we will encounter fascinating thematic trails, e.g. that of the Gothic castles, of Grunwald (where in 1410, the Polish and Lithuanian army defeated the Teutonic Knights in one of the greatest battles of the Middle Ages; every year in mid-July, the re-enactment of the battle attracts several dozen thousand spectators), or finally the Copernicus’ trail, which runs through places related to the most famous Polish astronomer, Nicolaus Copernicus, author of the heliocentric theory and one of the 16th-century forerunners of modern science, who spent 40 years of his life in Warmia (and now rests in the cathedral of Frombork).\n\nBut the greatest treasure of Warmia and Masuria is nature. Protected landscape areas, landscape parks, natural reserves (for fauna, flora, forests, steppes, peat-bogs, waters), special bird protection areas and their habitats cover more than half of the area of the Warmińsko-Mazurskie Voivodeship.\n\n6028846216_d47a974859_o.jpgThe 158 lakes included in the silent zone are covered by an absolute ban on using motor engines and sailing outside of the designated routes. The Masuria is first and foremost a kingdom of birds. The Łuknajno lake – a UNESCO Biosphere Reserve – protects a colony of the mute swan, the largest in Europe, as well as 96 other bird species, including the grebe, the botaurus, the Northern shoveller, the red-crested pochard, the little crake, the corn crake, and the terns. Predatory birds nest near the reserve: the lesser spotted eagle, the black kite and the red kite, the European honey buzzard, the white-tailed eagle, and the osprey. The hunting birds of prey may be watched from several lookout towers on the edges of the reserve.\n\nNietlickie Bagno is the largest crane-nesting area, and the island of Wysoki Ostrów on the Dobskie lake is the favourite place of cormorants and the grey heron.\n\nThere is also a European bison breeding centre in the Puszcza Borecka forest. The marshes and peat-bogs are home to otters, beavers and the European pond turtle. “When sailing across the lakes, you may see deer and wild boar swimming between the islands,” says Robert Kempa.","position":{"lat":54.13842741528557,"lng":21.78162265291667},"image":"data:image/png;base64,"},{"date": "2022-07-02", "id":"709cNRhSbeDTFwuv6pJlc","title":"Baltic sea, must have in your trip!","content":"Recreation, fun and good times – that’s a summer on the Baltic Sea. A holiday by the sea can be very restful, but it doesn’t always have to be the Mediterranean or the Indian Ocean. Often we look too far into the distance when heaven is actually so much closer to home. A holiday on the Baltic Sea offers a unique seaside atmosphere with 100% pure rest and relaxation just a two-hour drive from Berlin.\n\nWhat about hiking or riding?\n\nLife is never boring on the Baltic Sea. Away from the busy streets and hectic pace of big city life, travellers big and small will find plenty of opportunities to enjoy life, to make discoveries and to be amazed. This one-of-a-kind piece of Earth can be wonderfully explored by bike, on foot and even on horseback. Extensive hiking and biking trails lead along the coast, through the nature parks, and to quaint little villages. Here, hardcore cyclists will discover that the journey is the reward. Not for nothing is Poland’s Amber Coast one of the country’s most popular holiday destinations.\n\nPicturesque Wolin National Park\n\nA trip into Wolin National Park is one of the most beautiful experiences. A walk along the steep Polish coast will take you through shady beech woods to picturesque Turquoise Lake. This lake near the village of Wapnica on the island of Wolin owes its name to the almost unbelievable colour of its water. Near the little village of Lubin lies one of the region’s most popular natural outlooks, Zielonka Hill (81 m above the sea), with vast, expansive views that reach to the Świna river delta, Szczecin Lagoon and all the way to the Baltic Sea.\n\nWhite sandy beaches and bicycle trip on the Baltic Coast\n\nIf you’re looking for more than just lazing about the endless beaches and enjoying the sea, you could also explore the island by bike. Discovering the region along well-maintained and well-signposted bicycle trails is the perfect way to put yourself in a holiday mood! And if that’s not enough, an all-day outing offers a wonderful change of pace from the ‘dolce far niente’ of beach life. Just board a boat from the new pier next to the Vienna House Amber Baltic Miedzyzdroje hotel, sail on over to the neighbouring island of Usedom, visit the picturesque town of Ahlbeck on the German-Polish border, and decide from there what to do next.","position":{"lat":54.180185151806995,"lng":15.597127290547682},"image":"data:image/png;base64,"}]
const saveToSession = (data) => {
    sessionStorage.setItem(`data`, JSON.stringify(data));
}

const loadFromSession = () => {
    let data;

    try{
        data = JSON.parse(sessionStorage.getItem(`data`));
    }catch(e){
        data = null;
    }

    if(!data){
        return initialState;
    }

    return data;
}

const postSlice = createSlice({
    name: 'posts',
    initialState: loadFromSession(),
    reducers: {
        addPost(state, action){

            state.push({id: nanoid(), ...action.payload});
            saveToSession(state)
        },
        deletePost(state, action){
            const {id} = action.payload;
            const new_state = state.filter(p => p.id.toString() !== id.toString());
            saveToSession(new_state)

            return new_state;
        },
        updatePost(state, action){
            const {id} = action.payload;
            let post = state.find(p => p.id.toString() === id.toString())


            if(post){
                for(let property in action.payload){
                    post[property] = action.payload[property]
                }
            }
            saveToSession(state);
        }
    }
});

const selectAll = () => (state) => state.posts;
const selectId = (id) => (state) => state.posts.find(p => p.id.toString() === id?.toString());

export {selectAll, selectId};

export const {addPost, deletePost, updatePost} = postSlice.actions;

export default postSlice.reducer;